  true,\n\t\"url\": null,\n\t\"notes\": \"<p>1995-2016. Centers for Disease Control
  and Prevention (CDC).  State Tobacco Activities Tracking and Evaluation (STATE)
  System.  E-Cigarette Legislationu00e2u0080u0094Smokefree Indoor Air. The STATE System
  houses current and historical state-level legislative data on tobacco use prevention
  and control policies. Data are reported on a quarterly basis. Data include information
  related to state legislation on smokefree indoor air in areas such as: Bars, Commercial
  Day Care Centers, Government Multi-Unit Housing, Government Worksites, Home-Based
  Day Care Centers, Hotels and Motels, Personal Vehicles, Private Multi-Unit Housing,
  Private Worksites, Restaurants, Bingo Halls, Casinos, Enclosed Arenas, Grocery Stores,
  Hospitals, Hospital Campuses, Malls, Mental Health Outpatient and Residential Facilities,
  Prisons, Public Transportation, Racetrack Casinos, Substance Abuse Outpatient and
  Residential Facilities.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
